import React, { useState } from "react";

const PlaceManagement = () => {
  const [places, setPlaces] = useState([]);
  const [search, setSearch] = useState("");
  const [formData, setFormData] = useState({
    date: "",
    description: "",
    image: "",
    place: "",
  });
  const [editingIndex, setEditingIndex] = useState(null);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleAddOrUpdate = () => {
    const { date, description, image, place } = formData;
    if (!date || !description || !place) {
      alert("Date, Description, and Place are required.");
      return;
    }
    if (editingIndex !== null) {
      const updatedPlaces = [...places];
      updatedPlaces[editingIndex] = formData;
      setPlaces(updatedPlaces);
    } else {
      setPlaces([...places, formData]);
    }
    setFormData({ date: "", description: "", image: "", place: "" });
    setEditingIndex(null);
  };

  const handleEdit = (index) => {
    setFormData(places[index]);
    setEditingIndex(index);
  };

  const handleDelete = (index) => {
    const updatedPlaces = places.filter((_, i) => i !== index);
    setPlaces(updatedPlaces);
  };

  const filteredPlaces = places.filter(
    ({ date, description, place }) =>
      date.toLowerCase().includes(search.toLowerCase()) ||
      description.toLowerCase().includes(search.toLowerCase()) ||
      place.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4">Place Management</h1>

      <div className="mb-6 grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4">
        <input
          placeholder="Date"
          type="date"
          name="date"
          value={formData.date}
          onChange={handleInputChange}
          className="border rounded p-2 w-full"
        />
        <input
          placeholder="Description"
          type="text"
          name="description"
          value={formData.description}
          onChange={handleInputChange}
          className="border rounded p-2 w-full"
        />
        <input
          placeholder="Image URL"
          type="text"
          name="image"
          value={formData.image}
          onChange={handleInputChange}
          className="border rounded p-2 w-full"
        />
        <input
          placeholder="Place"
          type="text"
          name="place"
          value={formData.place}
          onChange={handleInputChange}
          className="border rounded p-2 w-full"
        />
        <button
          onClick={handleAddOrUpdate}
          className="bg-blue-500 text-white py-2 px-4 rounded hover:bg-blue-600"
        >
          {editingIndex !== null ? "Update" : "Add"}
        </button>
      </div>

      <div className="mb-6">
        <input
          placeholder="Search by Date, Description, or Place..."
          type="text"
          value={search}
          onChange={(e) => setSearch(e.target.value)}
          className="border rounded p-2 w-full"
        />
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {filteredPlaces.map((place, index) => (
          <div key={index} className="border rounded-lg p-4 shadow">
            <p className="font-bold">Date: {place.date}</p>
            <p>Description: {place.description}</p>
            {place.image && (
              <img
                src={place.image}
                alt={place.description}
                className="w-full h-40 object-cover rounded mt-2"
              />
            )}
            <p>Place: {place.place}</p>
            <div className="flex justify-between mt-4">
              <button
                onClick={() => handleEdit(index)}
                className="bg-green-500 text-white py-1 px-3 rounded hover:bg-green-600"
              >
                Edit
              </button>
              <button
                onClick={() => handleDelete(index)}
                className="bg-red-500 text-white py-1 px-3 rounded hover:bg-red-600"
              >
                Delete
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default PlaceManagement;
